import React, {useState} from 'react';
import ClassList from './ClassList';

function Music() {

    const data = [{ date: "2022-01-29", time: "10:00" }, { date: "2022-01-22", time: "10:30" }, { date: "2022-02-5", time: "10:00" }]

    const [showMusicDetails, setShowMusicDetails] = useState(false);
    const [previousClasses, setPreviousClasses] = useState(data)

    return (
        <div className="music">
            <ClassList classes={previousClasses} showMusicDetails={setShowMusicDetails} />
        </div>
    )
}

export default Music
